import classes from "./NavBa.module.css";
import { Link } from "react-router-dom";
import icon from "../Cart/icon";
const NavBa = (props) => {
  return (
    <div className={classes.navba}>
      <Link to="/browse">
        <p>Movie App</p>{" "}
      </Link>
      <Link to="/search">
        <div className={classes.svg}>
          <icon />
        </div>
      </Link>
    </div>
  );
};

export default NavBa;
